({params, imports}) => {
    const programEncounter = params.entity;
    const moment = imports.moment;
    const formElement = params.formElement;
    const _ = imports.lodash;
    let visibility = true;
    let value = null;
    let answersToSkip = [];
    let answersToShow = [];
    let validationErrors = [];
    let toBeShown = [];

    let allOptions = formElement.getApplicableAnswerConceptUUIDs();
    const kharifUUID = '58583b46-f8a3-486a-9903-9908899d44ef';
    const rabiUUID = 'b167e259-fc52-4f34-8043-3416692f707b';
    const zaidUUID = 'c0f902da-88e1-4206-84ea-29a6e20ba51b';
