    const vegetableUUID = '543d9cbd-1a62-4084-96e0-58c88262f0a2';

    const season = programEncounter.getObservationValue("5dd1b169-578e-4317-ac60-e2f6334690be");
    const cropType = programEncounter.getObservationValue("dd54808e-9fda-4644-bc7b-abef33d19942");

    // Kharif
    const kharifFeildCrop = season == kharifUUID && cropType == fieldCropUUID;
    const kharifVegitables = season == kharifUUID && cropType == vegetableUUID;

    if(kharifFeildCrop ) {
        toBeShown.push("a3d76033-fb19-4e59-925b-c5409d911788", "edc64af3-d049-4e8a-978a-ca0eb9ad00c3", "9b505590-481b-4005-98ba-b19e78f673bd", "3da55d35-38d4-4adf-9ad0-6552265f4737");
    }
    if(kharifVegitables ) {
        toBeShown.push("9b505590-481b-4005-98ba-b19e78f673bd", "d5db3f55-44bb-4e5d-86e3-bccce9364cc0", "d7f66cb3-b7a1-4d84-8718-ad5c5db76483", "846f1324-de88-46ca-b2e1-53a64a62639d");
    }

    // Rabi
    const rabiFeildCrop = season == rabiUUID && cropType == fieldCropUUID;
    const rabiVegitables = season == rabiUUID && cropType == vegetableUUID;

    if(rabiFeildCrop ) {
        toBeShown.push("6a40bace-73b7-4ddc-8483-a8081e637604","b90777e7-fa0a-4d13-95ef-76076509c377","c50830b0-3009-49f9-897b-8b96a6113ccb","e58d8cb4-0a91-46fd-b603-5f82307f3eb4")   
    }
    if(rabiVegitables ) {
        toBeShown.push("dcac9dd8-b24f-4b75-b168-beff35b4785c","4ab5b6df-236a-41ca-8112-7b658f89930d","af4f8834-462d-4a2a-8cc0-c5a92bd4ff94","cc83fae3-b93f-403b-8f52-2dc67b7dc0dd")
    }

    // Zaid
    const zaidFeildCrop = season == zaidUUID && cropType == fieldCropUUID;
    const zaidVegetables = season == zaidUUID && cropType == vegetableUUID;

    if(zaidFeildCrop ) {
        toBeShown.push("a3d76033-fb19-4e59-925b-c5409d911788")
    }
    if(zaidVegetables ) {
        toBeShown.push("d5db3f55-44bb-4e5d-86e3-bccce9364cc0","9b505590-481b-4005-98ba-b19e78f673bd","8ce24f68-6d0f-44fb-b39a-fb1a169f0415")
    }

    toBeShown = _.uniq(toBeShown);

    let toBeHidden = _.difference(allOptions, toBeShown);

    if(toBeHidden && toBeHidden.length > 0){
        _.forEach(toBeHidden, (answer) => {
            const answerToSkip = formElement.getAnswerWithConceptUuid(answer);
            if (answerToSkip) answersToSkip.push(answerToSkip);
        });
    }

    return new imports.rulesConfig.FormElementStatus(formElement.uuid, visibility, value, answersToSkip, validationErrors, answersToShow);
};

